import './App.css';

function App() {
  return (
    <div className="App">
      <Info /> 
      <AddItem /> 
        <p>
          My app is running woot woot! Waka Waka
        </p>
    </div>
  );
}

function Info() {
  return (
    <div>
      <h1>Testing Function</h1>
      <p>How are you doing</p>
    </div>
  );
}

function AddItem() {
  return (
    <form>
      <label for="text-form">Type Something: </label>
      <input type="text" id="text-form" />
    </form>
  );
}

export default App;
